import React from "react";
import img from "./img/loan2.jpg";
import img1 from "./img/loan1.jpg";
import img2 from "./img/loan3.jpg";

const Crousel = () => {
  return (
      <>
      <div className="container">
          <div className="row">
              <div className="col-md-10">
              <div id="carouselExampleSlidesOnly" class="carousel slide" data-bs-ride="carousel">
    <div class="carousel-inner">
      <div class="carousel-item  active"  data-bs-interval="2000">
        <img src="img/loan2.jpg" class="d-block  mx-auto img-fluid" alt="..."/>
      </div>
      <div class="carousel-item " data-bs-interval="2000">
        <img src="img/loan1.jpg" class="d-block  mx-auto img-fluid" alt="..."/>
      </div>
      <div class="carousel-item " data-bs-interval="2000">
        <img src="img/loan3.jpg" class="d-block  mx-auto img-fluid" alt="..."/>
      </div>
    </div>
  </div>
              </div>
          </div>
      </div>
      </>
  );
};

export default Crousel;
